import React from 'react'
import { Row, Col, Card, Table } from 'antd';

function ExistingData() {

    const clientColumns = [
        {
            title: 'Name',
            dataIndex: 'name',
            key: 'name',
        }
    ]

    const languageData = [
        { key: '1', name: 'English'}, { key: '2', name: 'Hindi'}, { key: '3', name: 'Tamil'}, { key: '4', name: 'Telugu'}, { key: '5', name: 'Kannada'}, { key: '6', name: 'Marathi'}, { key: '7', name: 'Gujarati'}
    ]

    const productData = [
        { key: '1', name: 'Loan'}, { key: '2', name: 'Credit Card'}, { key: '3', name: 'EMI On Debit Card'}, { key: '4', name: 'Consumer Durable'}, { key: '5', name: 'Common Borrower'}, { key: '6', name: 'Pay Later'}
    ]

    const segmentData = [{ key: '1', name: 'Pre-Due'}, { key: '2', name: 'Post-Due'}, { key: '6', name: 'Phase 1'}, { key: '7', name: 'Phase 2'}, { key: '8', name: 'Phase 3'} , {key: '9', name: 'Phase 4 (Pre 90)'}, {key: '10', name: 'Phase 4 (90+)'}]

    const stageData = [{key: '1', name: 'Delay'}, { key: '2', name: 'Default'}, { key: '3', name: 'Connecting'}, { key: '4', name: 'Callback'}]

    const typeData = [
        { key: '1', name: 'Reminder'}, { key: '2', name: 'Impact'}, { key: '3', name: 'Legal' }, { key: '4', name: 'Follow up'}, { key: '5', name: 'Relationship'}, { key: '6', name: 'Action'}, { key: '7', name: 'Urgency'}
    ]

    const categoryData = [{ key: '1', name: 'Basic'}, { key: '2', name : 'Detailed' }, { key: '3', name : 'Urgency' }, { key: '4', name : 'Charges' }, { key: '5', name : 'CIBIL' }, { key: '6', name : 'Action' }, { key: '7', name : 'NC_1' }, { key: '8', name :'NC_2' }, { key: '9', name : 'Clean Track' }, { key: '10', name : 'Good Order' }, { key: '11', name :'Long Lasting' }, { key: '12', name :'Relationship Status' }, { key: '13', name :'Avoid Action' }, { key: '14', name :'Action To Be Initiated' }, { key: '15', name :'Action Initiated' }, { key: '16', name :'Degradation Of Account' }, { key: '17', name :'Legal Inbound' }, { key: '18', name :'PTP Reminder' }, { key: '19', name :'Broken PTP' },  { key: '20', name :'Legal To Be Initiated' }, { key: '21', name : 'Other' }, { key: '22', name :'Reacted' }, { key: '23', name :'CM to FOS' }, { key: '24', name :'FOS to CM' }]

    const LanguageTable = () => (
        <Card title="Languages">
            <Table
                pagination={false}
                columns={clientColumns} 
                dataSource={languageData} 
                rowKey='id'
                size="small"
            />
        </Card>
    )
    const ProductTable = () => (
        <Card title="Products">
            <Table
                pagination={false}
                columns={clientColumns} 
                dataSource={productData} 
                rowKey='id'
                size="small"
                scroll={{ y: 155 }}
            />
        </Card>
    )
    const SegmentTable = () => (
        <Card title="Segments">
            <Table
                pagination={false}
                columns={clientColumns} 
                dataSource={segmentData} 
                rowKey='id'
                size="small"
                scroll={{ y: 155 }}
            />
        </Card>
    )
    const StageTable = () => (
        <Card title="Stages">
            <Table
                pagination={false}
                columns={clientColumns} 
                dataSource={stageData} 
                rowKey='id'
                size="small"
            />
        </Card>
    )
    const TypeTable = () => (
        <Card title="Types">
            <Table
                pagination={false}
                columns={clientColumns} 
                dataSource={typeData} 
                rowKey='id'
                size="small"
                scroll={{ y: 155 }}
            />
        </Card>
    )
    const CategoryTable = () => (
        <Card title="Categories">
            <Table
                pagination={false}
                columns={ clientColumns } 
                dataSource={ categoryData } 
                rowKey='id'
                size="small"
                scroll={{ y: 155 }}
            />
        </Card>
    ) 

    return (
        <div>
            <Row gutter={16}>
				<Col xs={24} sm={24} md={24} lg={3} xxl={6}>
					<LanguageTable />
				</Col>
                <Col xs={24} sm={24} md={24} lg={4} xxl={6}>
					<ProductTable />
				</Col>
                <Col xs={24} sm={24} md={24} lg={4} xxl={6}>
					<SegmentTable />
				</Col>
                <Col xs={24} sm={24} md={24} lg={3} xxl={6}>
					<StageTable />
				</Col>
				<Col xs={24} sm={24} md={24} lg={4} xxl={6}>
					<TypeTable />
				</Col>
                <Col xs={24} sm={24} md={24} lg={5} xxl={6}>
					<CategoryTable />
				</Col>
            </Row>
        </div>
    )
}

export default ExistingData
